for ($i = 13; $i -lt $datasplit.Count; $i++) {
    
    $complete = -join ($data[$i -13],$data[$i -12],$data[$i -11],$data[$i -10],$data[$i -9],$data[$i -8],$data[$i -7],$data[$i -6],$data[$i -5],$data[$i -4],$data[$i -3], $data[$i -2], $data[$i -1], $data[$i])
